import React, { Component } from 'react';
import {Grid} from 'react-bootstrap'

import './App.css';

class App extends Component {
  render() {
    return (
      <div className="container "> 
        <Grid className='purchase-card'>
          Hello world
        </Grid>
      </div>
    );
  }
}

export default App;
